import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';

import Main from './pages/main';

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="App">
        <Routes></Routes>
        <Route path="/" component={Main} />
      </div>
    );
  }
}

export default App;
